import React, { Component, useRef , useEffect } from 'react';
import logo from './logo.svg';
import './App.css';
import EventsParent from './components/eventsParent';
import Contact from './components/contact';
import Welcome from './components/welcome';
import Footer from './components/footer';
import Aos from 'aos';
import 'aos/dist/aos.css';
import SearchPage from './components/searchpage'; 
import { Link, Route, Switch } from 'react-router-dom';
import INSAT from './INSAT.svg';
import "./components/styling.css";
import { Button } from './components/bootstrap-component';
import AnchorLink from 'react-anchor-link-smooth-scroll'
import SignUpForm from './pages/SignUpForm';
import TheCalendar from './components/theCalendar';
import ClubSlider from './components/clubSlider';
import Login from './components/login';
import {BrowserRouter as Router} from 'react-router-dom';


sswindow.addEventListener('scroll', function(){
  let offset = window.pageYOffset;
/* document.getElementById('layer').style.backgroundPositionY = offset*0.7 + "px";
document.getElementById('layer_contact').style.backgroundPositionY = offset*0.7 + "px";
document.getElementById('layer_calendar').style.backgroundPositionY = offset*0.7 + "px";
*/})

class App extends Component {
  state = { 
    navBackground:''}


    componentDidMount() {
      document.addEventListener("scroll", () => {
        const backgroundcolor = window.scrollY < 100 ? "transparent" : "	#A0A0A0";

        this.setState({ navBackground: backgroundcolor });
      });
    }
  render() { 
    const {navBackground}=this.state;
    return (  


      <React.Fragment  >
      <nav className="navbar navbar-expand-lg   fixed-top" 
      style={{backgroundColor: navBackground, opacity:"0.7"}} >
      <a className="navbar-brand ml-5" href="#">
          <img src={INSAT} alt="INSAT" style={{ width: '35px' }} />
        </a>
        <button
          className="navbar-toggler here" 
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span>
            <i className="fas fa-bars" style={{ color: '#fff' }} />
          </span>
        </button>

        <div className="collapse navbar-collapse" id="navbarSupportedContent">

          <ul className="navbar-nav m-auto nav-pills">

            <li className="nav-item " href='#about'>

              <AnchorLink className="nav-link text-white text-uppercase ml-5" 
              href='#about'
            >
                About us

              </AnchorLink>

            </li>
            <li className="nav-item" href='#contact'>

              <AnchorLink href='#contact'
                className="nav-link text-white text-uppercase ml-3"

               >

                Contact Us
              </AnchorLink>

            </li>

            <li className="nav-item" href='#clubs'>

              <AnchorLink
                className="nav-link text-white text-uppercase ml-3"
                href='#clubs'
                >
                Clubs
              </AnchorLink>

            </li>
            <li className="nav-item" href='#events' >

              <AnchorLink href='#events'
                className="nav-link text-white text-uppercase ml-3"


                >
                Events
              </AnchorLink>

            </li>
             <li className="nav-item  btn btn-light ml-3"

             >


               <Link  to="/up" >

                Sign Up  
                </Link>

            </li>
            <li className="nav-item  btn btn-light ml-3"
             >


               <Link  to="/SignIn" >

             Sign In  
             </Link>


            </li>

          </ul>



        </div>

        <div className='burger'>
            <div className='line1'></div>
            <div className='line2'></div>
            <div className='line3'></div>
          </div>
      </nav>

    <Welcome/>




     <section id="events" >    <EventsParent/> </section>
     <TheCalendar/>
     <section id="clubs" >     <ClubSlider /> </section> 


     <section id="contact" > <Contact/></section>

      <Footer/>
      </React.Fragment>


     );
  }
}

export default App;
